INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(1,1,1,'',1,'',378644400,'grey','hook','nocturnal, fly silently',1,'brown','Strigidae','bush','MoreporkMaunga','The morepork is NZ’s only surviving native owl. Often heard in the forest at dusk and throughout the night, the morepork is known for its haunting, melancholic call. It was introduced to New Zealand between 1906 and 1910 to try to control smaller introduced birds.
Morepork are commonly found in forests throughout mainland New Zealand and on offshore islands. They are less common within the drier open regions of Canterbury and Otago. They are classified as not threatened.

Physical description
Morepork are speckled brown with yellow eyes set in a dark facial mask. They have a short tail.
The females are bigger than the males.
Head to tail they measure around 29cm and the average weight is about 175g.
They have acute hearing and are sensitive to light.
They can turn their head through 280 degrees.

Nocturnal birds of prey
Morepork are nocturnal, hunting at night for large invertebrates including beetles, weta, moths and spiders. They will also take small birds, rats and mice. They fly silently as they have soft fringes on the edge of the wing feathers. They catch prey using large sharp talons or beak. By day they roost in the cavities of trees or in thick vegetation. If they are visible during the day they can get mobbed by other birds and are forced to move.

Nesting and breeding
Morepork nest in tree cavities, in clumps of epiphytes or among rocks and roots.
The female can lay up to three eggs, but generally two, usually between September and November.
The female alone incubates the eggs for about 20 to 32 days during which time the male brings in food for her.
Once the chicks hatch, the female stays mainly on the nest until the owlets are fully feathered.
They fledge around 37-42 days.
Depending on food supply often only one chick survives and the other may be eaten.

Maori tradition
In Maori tradition the morepork was seen as a watchful guardian. It belonged to the spirit world as it is a bird of the night. Although the more-pork or ruru call was thought to be a good sign, the high pitched, piercing, ‘yelp’ call was thought to be an ominous forewarning of bad news or events.','yellow','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/morepork-ruru/','Morepork','Ruru','Southern Boobook','Pigeon','morepork','non threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(2,1,1,'',1,'',378644400,'black','short','restless',1,'black,grey','Monarchidae','garden,bush','Fantail','Known for its friendly ‘cheet cheet’ call and energetic flying antics, the aptly named fantail is one of the most common and widely distributed native birds on the New Zealand mainland.

It is easily recognized by its long tail which opens to a fan. It has a small head and bill and has two colour forms, pied and melanistic or black. The pied birds are grey-brown with white and black bands.

The fantail is widespread throughout New Zealand and its offshore islands, including the Chatham Islands and Snares Islands. It is common in most regions of the country, except in the dry, open country of inland Marlborough and Central Otago, where frosts and snow falls are too harsh for it. It also breeds widely in Australia and some Pacific Islands.
The fantail is one of the few native bird species in New Zealand that has been able to adapt to an environment greatly altered by humans. Originally a bird of open native forests and scrub, it is now also found in exotic plantation forests, in orchards and in gardens. Fantails stay in pairs all year but high mortality means that they seldom survive more than one season.
The success of the species is largely due to the fantail’s prolific and early breeding. Juvenile males can start breeding between 2–9 months old, and females can lay as many as 5 clutches in one season, with between 2–5 eggs per clutch.
Fantail populations fluctuate greatly from year to year, especially when winters are prolonged or severe storms hit in spring. However, since they are prolific breeders, they are able to spring back quickly after such events.
Both adults incubate eggs for about 14 days and the chicks fledge at about 13 days. Both adults will feed the young, but as soon as the female starts building the next nest the male takes over the role of feeding the previous brood. Young are fed about every 10 minutes – about 100 times per day!
In Māori mythology the fantail was responsible for the presence of death in the world. Maui, thinking he could eradicate death by successfully passing through the goddess of death, Hine-nui-te-po, tried to enter the goddess’s sleeping body through the pathway of birth. The fantail, warned by Maui to be quiet, began laughing and woke Hine-nuite- po, who was so angry that she promptly killed Maui.

Did you know?
Fantails use three methods to catch insects. The first, called hawking, is used where vegetation is open and the birds can see for long distances. Fantails use a perch to spot swarms of insects and then fly at the prey, snapping several insects at a time.
The second method that fantails use in denser vegetation is called flushing. The fantail flies around to disturb insects, flushing them out before eating them.
Feeding associations are the third way fantails find food. Every tramper is familiar with this method, where the fantail follows another bird or animal to capture insects disturbed by their movements. Fantails frequently follow feeding silvereyes, whiteheads, parakeets and saddlebacks, as well as people.
 ','black','http://en.wikipedia.org/wiki/Fantail','Fantail','Piwakawaka','New Zealand Fantail','sparrow','fantail','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(3,1,1,'',1,'',378644400,'black','medium','great imitator of other birds',1,'black','Meliphagidae/ Honeyeaters','bush,garden','Tui_on_flax','Tūī are common throughout New Zealand in forests, towns and on off-shore islands. They are adaptable and are found not only in native forests, bush reserves and bush remnants but also in suburban areas, particularly in winter if there is a flowering gum about.
Can often be heard singing their beautiful melodies long before they are spotted. If you are fortunate to glimpse one you will recognise them by their distinctive white tuft under their throat, which contrasts dramatically with the metallic blue-green sheen to their underlying black colour.

Tūī are unique (endemic) to New Zealand and belong to the honeyeater family, which means they feed mainly on nectar from flowers of native plants such as kōwhai, puriri, rewarewa, kahikatea, pohutukawa, rātā and flax. Occasionally they will eat insects too. Tūī are important pollinators of many native trees and will fly large distances, especially during winter for their favourite foods.
Tūī will live where there is a balance of ground cover, shrubs and trees. Tūī are quite aggressive, and will chase other tūī and other species (such as bellbird, silvereye and kereru) away from good food sources.

An ambassador for successful rejuvenation
A good sign of a successful restoration programme, in areas of New Zealand, is the sound of the tūī warbling in surrounding shrubs. These clever birds are often confusing to the human ear as they mimic sounds such as the calls of the bellbird. They combine bell-like notes with harsh clicks, barks, cackles and wheezes.

Breeding facts
Courting takes place between September and October when they sing high up in the trees in the early morning and late afternoon. Display dives, where the bird will fly up in a sweeping arch and then dive at speed almost vertically, are also associated with breeding. Only females build nests, which are constructed from twigs, fine grasses and moss.

Where can tūī be found
The tūī can be found throughout the three main islands of New Zealand. The Chatham Islands have their own subspecies of tūī that differs from the mainland variety mostly in being larger.','black','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/tui/','Tui','Prosthemadera novaeseelandiae','Tui','blackbird','tui2','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(4,1,1,'',1,'',378644400,'black','short,pointed,curved','only bird to mate face to face',1,'brown','Notiomystis','bush','Hihi_Stitchbird1','The stitchbird/hihi (Notiomystis cincta) is one of New Zealand’s rarest birds.  A medium-sized forest species, hihi compete with tui and bellbirds for nectar, insects and small fruits.
But apart from diet, hihi share few qualities with tui and bellbird, which are members of the honeyeater family.  Recent DNA analysis has shown that hihi are in fact the sole representative of another bird family found only in New Zealand whose closest relatives may be the iconic wattlebirds that include kokako, saddleback and the extinct huia.
How to recognise hihi

Male and female hihi look quite different.  He flaunts a flashy plumage of black head with white ‘ear’ tufts, bright yellow shoulder bars and breast bands and a white wing bar and has a mottled tan-grey-brown body.
She is more subdued with an olive-grey-brown body cover, white wing bars and small white ‘ear’ tufts.  They both have small cat-like whiskers around the beak and large bright eyes.
Hihi can be recognised by their posture of an upward tilted tail and strident call from which the name ‘stitchbird’ derives.  A 19th century ornithologist Sir Walter Buller described the call made by the male hihi as resembling the word ‘stitch’.  This call sounds a little like two stones being repeatedly stuck together.  Both males and females also have a range of warble-like calls and whistles.

Unique characteristics
Unlike most other birds, hihi build their nests in tree cavities.  The nest is complex with a stick base topped with a nest cup of finer twigs and lined with fern scales, lichen and spider web.
Hihi have a diverse and unusual mating system.  A female may breed with a single male or with several.  These arrangements can make determining the parentage of chicks a challenge.  Hihi are also the only birds known to sometimes mate face to face.

Hihi research
    An active research programme with Massey and Auckland universities, as well as other institutes, has greatly increased our knowledge of hihi biology.
Hihi have been found to have a fascinating and complex mating system.  Males pair up with a female in their territory while also seeking to mate with other females in the neighbourhood.  To ensure the chicks are his, males need to produce large amounts of sperm to dilute that of other males.  And to avoid wasting this, the male has to assess exactly when a female is ready to breed.  In the days leading up to laying, when a female is weighed down with developing eggs, a number of males may chase her for hours at a time, all attempting to mate with her.
Research has also resulted in developing techniques for managing nesting behaviour, for example, managing nest mites, cross fostering and sexing of chicks and habitat suitability.
Management of the captive population at the Pukaha Mount Bruce National Wildlife Centre in eastern Wairarapa has also contributed to understanding the role of avian diseases in managing hihi populations.  Diseases such as Aspergillosis, a fungal infection of the respiratory tract, and Coccidiosis, an intestinal parasite, have been found to affect wild hihi survivial.
Current research programmes include developing a technique to measure the size of the Little Barrier hihi population and assess its health and viability.  Another study, on Tiritiri Matangi, is looking at the effect of carotenoid availability on hihi health (carotenoids are used for the yellow colour in male hihi feathers and egg yolk, and are important for health).
      

Where to find:  —Little Barrier, Tiritiri Matangi, Kapiti Islands, Kaori Wildlife Sanctuary (Zealandia).','brown','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/stitchbird/','Stitchbird','Tauhou/Hihi','Stitchbird','sparrow','Hihi_Stitchbird','vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(5,1,1,'',1,'',378644400,'brown','long','flightless',1,'brown','Ratites','coast,bush','823px-Dinornis1387','Richard Owen, who became director of London’s Museum of Natural History, was the first to recognise that a bone fragment he was shown in 1839 came from a large bird. When later sent collections of bird bones, he managed to reconstruct moa skeletons. In this photograph, published in 1879, he stands next to the largest of all moa, Dinornis maximus (now D. novaezealandiae), while holding the first bone fragment he had examined 40 years earlier. Richard Owen, Memoirs on the extinct wingless birds of New Zealand. Vol. 2. London: John van Voorst, 1879, plate XCVII','brown','http://www.lib.utexas.edu/books/nzbirds/html/txu-oclc-7314815-2-31-p-097.html','Moa','Dinornis novaezealandiae','Moa','ostrich','','extinct',X'');
