INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(9,1,1,'',1,'',378644400,'brown','short','gregarious, curious',1,'brown','Passeridae','garden','Sparrow_IMG_6604','Introduced, now found abundantly in almost all areas of NZ. This is the most widely distributed wild bird.','yellow','http://en.wikipedia.org/wiki/Sparrow','Sparrow','House sparrow','House Sparrow','sparrow','Sparrow_XC112666-Pasdom_Sohar_27dec2009','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(10,1,1,'',1,'',378644400,'grey','long','Up to 1.8m wingspan. Hunt by diving with up to 100km/h so they can catch fish deeper than most other fishing airborne bird species. An air sac under the skin in their face cushions the impact on the water. ',1,'white','Sulidae','coast','Gannet_IMG_6624','Adults are mostly white, with black flight feathers at the wingtips and lining the trailing edge of the wing. The central tail feathers are also black. The head is yellow, with a pale blue-grey bill edged in black, and blue-rimmed eyes. Their breeding habitat is on islands and the coast of New Zealand, Victoria and Tasmania, with 87% of the adult population in New Zealand. These birds are plunge divers and spectacular fishers, plunging into the ocean at high speed. They mainly eat squid and forage fish which school near the surface. It has the same colours and similar appearance to the Northern Gannet. They normally nest in large colonies on coastal islands. In New Zealand there are colonies of over 10,000 breeding pairs each at Three Kings Islands, Whakaari / White Island and Gannet Island. There is a large protected colony on the mainland at Cape Kidnappers (6,500 pairs). There are also mainland colonies at Muriwai and Farewell Spit, as well as numerous other island colonies. Gannet pairs may remain together over several seasons. They perform elaborate greeting rituals at the nest, stretching their bills and necks skywards and gently tapping bills together. The adults mainly stay close to colonies, whilst the younger birds disperse.','black','http://www.teara.govt.nz/en/gannets-and-boobies/page-2','Gannet','Takapu (Morus serrator)','Australasian Gannet','albatross','gannet','not threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(11,1,1,'',1,'',378644400,'black','short','largely insectivore/fruit in winter',1,'black','Petroicidae','bush','NorthIsland_Tomtit_steintil','The New Zealand tomtit (Petroica macrocephala) looks similar to a robin. They are a small endemic bird with a large head, a short bill and tail, and live in forest and scrub.
The Māori name of the North Island Tomtit is miromiro, while the South Island Tomtit is known as ngirungiru.
There are five subspecies of tomtit/miromiro, each restricted to their own specific island or island group: North Island, South Island, the Snares Islands, the Chatham Islands and the Auckland Islands.','black','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/tomtit-miromiro/','Tomtit (South Island)','Ngirungiru (Miromiro)','Tomtit','sparrow','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(12,1,1,'',1,'',378644400,'yellow','medium','odd and quirky',1,'black','Sturnidae','garden','Starling_IMG_6964','Introduced to NZ, commonly seen around cities, gardens and the open country. Starlings are small to medium-sized passerine birds in the family Sturnidae. The name "Sturnidae" comes from the Latin word for starling, sturnus. Many Asian species, particularly the larger ones, are called mynas, and many African species are known as glossy starlings because of their iridescent plumage. Starlings are native to the Old World, from Europe, Asia and Africa, to northern Australia and the islands of the tropical Pacific. Several European and Asian species have been introduced to these areas as well as North America, Hawaii and New Zealand, where they generally compete for habitat with native birds and are considered to be invasive species. The starling species familiar to most people in Europe and North America is the common starling, and throughout much of Asia and the Pacific the common myna is indeed common.         Starlings have strong feet, their flight is strong and direct, and they are very gregarious. Their preferred habitat is fairly open country, and they eat insects and fruit. Several species live around human habitation, and are effectively omnivores. Many species search for prey such as grubs by "open-bill probing", that is, forcefully opening the bill after inserting it into a crevice, thus expanding the hole and exposing the prey; this behavior is referred to by the German verb zirkeln (pronounced [ˈtsɪʁkəln]).         Plumage of many species is typically dark with a metallic sheen. Most species nest in holes, laying blue or white eggs.         Starlings have diverse and complex vocalizations, and have been known to embed sounds from their surroundings into their own calls, including car alarms and human speech patterns. The birds can recognize particular individuals by their calls, and are currently the subject of research into the evolution of human language.','black','http://en.wikipedia.org/wiki/Starling','Starling','Starling','European Starling','blackbird','starling','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(13,1,1,'',1,'',378644400,'brown','short','group together in winter',1,'brown/red/yellow','Fringillidae','garden','Goldfinch_IMG_6721','Commonly kept and bred in captivity around the world because of their distinctive appearance and pleasant song','red/brown','http://www.nzbirds.com/birds/goldfinch.html','Goldfinch','Carduelis carduelis','European Goldfinch','sparrow','goldfinch','least concern',X'');
