INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(17,1,1,'',1,'',378644400,'red','duck','',1,'black','Notiomystis','water,bush','BlackSwanCygnus_atratus','A large waterbird, a species of swan, which breeds mainly in the southeast and southwest regions of Australia. The species was hunted to extinction in New Zealand, but later reintroduced. Within Australia they are nomadic, with erratic migration patterns dependent upon climatic conditions. Black Swans are large birds with mostly black plumage and red bills. They are monogamous breeders that share incubation duties and cygnet rearing between the sexes. Black Swans can be found singly, or in loose companies numbering into the hundreds or even thousands. Black Swans are popular birds in zoological gardens and bird collections, and escapees are sometimes seen outside their natural range.','grey,black','http://en.wikipedia.org/wiki/Black_Swan','Black Swan','Black Swan','Black Swan','swan','Black_Swan_20110325_XC74379','threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(18,1,1,'',1,'',378644400,'brown','short','odd and quirky',1,'yellow/brown/green','Zosteropidae','garden','Silvereye_DSC09462','A small olive green forest bird with white rings around its eyes.
These friendly birds were self introduced in the 1800s and now have a wide distribution throughout NZ.
The silvereye has a wide distribution throughout New Zealand. They can be found from sea level to above the tree line but they are not abundant in deep forest or open grassland.
Slightly smaller than a sparrow, the silvereye is olive-green with a ring of white feathers around the eye. Males have slightly brighter plumage than females. They have a fine tapered bill and a brush tipped tongue like the tui and bellbird.
Silvereye''s mainly eat insects, fruit and nectar.
The silvereye was first recorded in New Zealand in 1832 and since there is no evidence that it was artificially introduced, it is classified as a native species. Its Māori name, tauhou, means stranger or more literally, new arrival.','black','http://en.wikipedia.org/wiki/Fantail','Silvereye','Waxeye/ Tauhou','Silver-eye','sparrow','silvereye-song-22sy','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(19,1,1,'',1,'',378644400,'brown','short','odd and quirky',1,'brown/green','Meliphagidae/ Honeyeaters','bush','Anthornis_melanura_New_Zealand_8','Most New Zealanders can easily recognise the bellbird by its melodious song, which Captain Cook described as sounding ‘like small bells exquisitely tuned’.
      Well camouflaged, the bellbird is usually heard before it is seen.
 Females are dull olive-brown, with a slight blue sheen on the head and a pale yellow cheek stripe. Males are olive green, with a purplish head and black outer wing and tail feathers.

Bellbirds are unique to New Zealand, occurring on the three main islands, many offshore islands and also the Auckland Islands.

When Europeans arrived in New Zealand, bellbirds were common throughout the North and South Islands. 
Their numbers declined sharply during the 1860s in the North Island and 1880s in the South Island, about the time that ship rats and stoats arrived. For a time it was thought they might vanish from the mainland. Their numbers recovered somewhat from about 1940 onwards, but they are almost completely absent on the mainland north of Hamilton, and are still rare in parts of Wellington, Wairarapa and much of inland Canterbury and Otago.
      Bellbirds live in native forest (including mixed podocarp-hardwood and beech forest) and regenerating forest, especially where there is diverse or dense vegetation. They can be found close to the coast or in vegetation up to about 1200 metres. In the South Island they have been found inhabiting plantations of eucalypts, pines or willows. They can be spotted in urban areas, especially if there is bush nearby.
Typically they require forest and scrub habitats, reasonable cover and good local food sources during the breeding season, since they do not travel far from the nest. However, outside the breeding season they may travel many kilometres to feed, especially males. A pair can raise two broods in a season.
Bellbird song comprises three distinct sounds resembling the chiming of bells. They sing throughout the day, but more so in the early morning and late evening. The alarm call is a series of loud, rapidly repeated, harsh staccato notes.
','black','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/bellbird-korimako/facts/','Bellbird','Korimako (Anthornis melanura)','New Zealand Bellbird','blackbird','bellbird-56','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(20,1,1,'',1,'',378644400,'brown','long','odd and quirky',1,'brown','Ratites','bush','LittleSpottedKiwi_Apteryx_owenii','The kiwi is the national icon of New Zealand and the unofficial national emblem.
The closest relatives to kiwi today are emus and cassowaries in Australia, but also the now-extinct moa of New Zealand. There are five species of kiwi:
      Brown kiwi (Apteryx mantelli)
      Rowi (Apteryx rowi)
      Tokoeka (Apteryx australis)
      Great spotted kiwi or roroa (Apteryx haastii)
      Little spotted kiwi (Apteryx owenii)
New Zealanders have been called Kiwis since the nickname was bestowed by Australian soldiers in the First World War.
The kiwi is a curious bird: it cannot fly, has loose, hair-like feathers, strong legs and no tail. Mostly nocturnal, they are most commonly forest dwellers, making daytime dens and nests in burrows, hollow logs or under dense vegetation. Kiwi are the only bird to have nostrils at the end of its very long bill which is used to probe in the ground, sniffing out invertebrates to eat, along with some fallen fruit. It also has one of the largest egg-to-body weight ratios of any bird - the egg averages 15 per cent of the female''s body weight (compared to two per cent for the ostrich).
Adult kiwi usually mate for life, and are strongly territorial. Females are larger than males (up to 3.3 kg and 45 cm). The brown kiwi, great spotted kiwi, and the Fiordland and Stewart Island forms of tokoeka are “nationally vulnerable”, the third highest threat ranking in the New Zealand Threat Classification System; and the little spotted kiwi is classified as “at risk (recovering)”.

read the long story here
http://www.teara.govt.nz/en/kiwi/page-1','brown','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/kiwi/','Kiwi, N.I. Brown ','Roroa (Apteryx)','North Island Brown Kiwi','duck','is_kiwi','threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(21,1,1,'',1,'',378644400,'black','hook','only in southern alps',1,'green','Strigopoidea','bush','800px-Nestor_notabilis_-Fiordland_National_Park-8a','Rated as one of the most intelligent birds in the world.
If you are a frequent visitor to or live in an alpine environment you will know the kea well. Kea and Kaka belong to the NZ parrot superfamily. Raucous cries of keeaa often give away the presence of these highly social and inquisitive birds. However, their endearing and mischievous behaviour can cause conflict with people.

Kea (Nestor  notabilis) are an endemic parrot of the South Island''s high country. Although kea are seen in reasonable numbers throughout the South Island, the size of the wild population is unknown - but is estimated at between 1,000 and 5,000 birds.
To survive in the harsh alpine environment kea have become inquisitive and nomadic social birds - characteristics which help kea to find and utilise new food sources. Their inquisitive natures often cause kea to congregate around novel objects and their strong beaks have enormous manipulative power.
Kea are a protected species.
Kea grow up to 50 cm long and although mostly vegetarian, also enjoy grubs and insects.
The kea is related to the forest kaka (Nestor meridionalis) and is thought to have developed its own special characteristics during the last great ice age by using its unusual powers of curiosity in its search for food in a harsh landscape.
Nests are usually found among boulders in high altitude forest where the birds lay between two and four eggs during the breeding season from July and January.','brown','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/kea/','Kea','Nestor notabilis','New Zealand Kea','pigeon','kea2','vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(22,1,1,'',1,'',378644400,'brown','short','odd and quirky',1,'grey','Pigeons and Doves (Columbidae)','bush/garden','New_Zealand_Pigeon_Southstar_02','New Zealand''s native pigeon, also known as kererū, kūkū and kūkupa and wood pigeon, is the only disperser of large fruits, such as those of karaka and taraire, we have. The disappearance of the kererū would be a disaster for the regeneration of our native forests.

The kererū is a large bird with irridescent green and bronze feathers on its head and a smart white vest. The noisy beat of its wings is a distinctive sound in our forests. The pigeon is found in most lowland native forests of the North, South and Stewart/Rakiura islands and many of their neighbouring islands.There are two species of native pigeon, the New Zealand pigeon (Hemiphaga novaeseelandiae) known to the Maori as kererū, or in Northland as kūkū or kūkupa, and the Chatham Islands pigeon (Hemiphaga chathamensis) or parea.

The parea is found mainly in the south-west of Chatham Island. While there are only about 500 parea left, the species has made a remarkable recovery over the past 20 years,  due to habitat protection and predator control.
Two other kinds of native pigeon became extinct on Raoul Island and Norfolk Island last century, probably due to hunting and predation
Since the extinction of the moa, the native pigeon is now the only seed disperser with a bill big enough to swallow large fruit, such as those of karaka, tawa and taraire.
It also eats leaves, buds and flowers, the relative amounts varying seasonally and regionally, e.g. in Northland the birds eat mostly fruit.
Kererū are large birds and can measure up to 51 cm from tail to beak, and weigh about 650g.
Long-lived birds, they breed slowly. Key breeding signals are spectacular display flights performed mainly by territorial males. They nest mainly in spring/early summer producing only one egg per nest, which the parents take turns to look after during the 28-day incubation period.
The chick grows rapidly, leaving the nest when about 40 days old. It is fed pigeon milk, a protein-rich milky secretion from the walls of the parents'' crops, mixed with fruit pulp.  When much fruit is available, some pairs of kererū will have a large chick in one nest and be incubating an egg in another nearby. Fledglings spend about two weeks with their parents before becoming fully independent, but have remained with their parents during autumn and winter in some cases.','brown','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/nz-pigeon-kereru/','Kererū','Hemiphaga novaeseelandiae/ Wood Pigeon','New Zealand Pigeon','pigeon','kereru','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(23,1,1,'',1,'',378644400,'brown','short','flies quick, hums',1,'grey','Acanthisittidae (New Zealand Wrens)','bush/garden','Rifleman_Acanthisitta_chloris','The Rifleman is New Zealand''s smallest endemic bird, with fully grown adults reaching around 8 cm. The male Rifleman is bright green on the dorsal side while the female is of a more somber brownish tone and her head and back are flecked with ochre. Male birds typically weigh around 6 g, females 7 g. Both birds are white on their under surfaces and have white eyebrow stripes. They have short, rounded wings, a very short tail, and a long thin awl-like bill which is slightly upturned for insertion into cracks. The Rifleman flies quickly with a wing beat producing a characteristic humming sound like a humming bird.The Rifleman is named after a colonial New Zealand regiment because its plumage drew similarities with the military uniform of a rifleman.','brown','http://en.wikipedia.org/wiki/Rifleman_(bird)','Rifleman','Titipounamou (Acanthisitta chloris)','Rifleman','sparrow','Rifleman','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(24,1,1,'',1,'',378644400,'brown','hook','odd and quirky',1,'green','Psittacidae','bush/garden','Cyanoramphus_novaezelandiae_-Kapiti_Island,_New_Zealand-8','The three species of Kākāriki or New Zealand parakeets are the most common species of parakeet in the genus Cyanoramphus, family Psittacidae. The birds'' Māori name, which is the most commonly used, means small parrot. The three species on mainland New Zealand are the Yellow-crowned Parakeet, Cyanoramphus auriceps, the Red-crowned Parakeet or Red-fronted Parakeet, C. novaezelandiae, and the critically endangered Malherbe''s Parakeet (or Orange-fronted Parakeet), C. malherbi.','brown','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/nz-parakeet-kakariki/nz-parakeet-kakariki/','Kakariki','Cyanoramphus novaezelandiae','Red-fronted Parakeet','pigeon','kakariki','unknown',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(25,1,1,'',1,'',378644400,'black','short,pointed','Very active. Absent from open country and alpine areas',1,'grey','Acanthizidae','bush/garden','GreyWarbler','The grey warbler/riroriro (Gerygone igata) is a relatively inconspicuous grey bird that flits about the canopy of the forest but its call permeates the forest and takes the edge off a hard uphill slog for any attentive tramper.
These diminutive insectivorous birds busy themselves along branches seeking out small invertebrates.
Grey warbler was the surprise recipient of the title of New Zealand''s best-loved bird in 2007.','black','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/grey-warbler-riroriro/','Grey warbler','Riroriro (Gerygone igata)','Gray Gerygone','sparrow','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(26,1,1,'',1,'',378644400,'orange','short','Defends its breading territory',1,'black','Turdidae','garden','Blackbird','Common introduced garden bird. Male and female dimorph: male black, female brown.','brown','http://en.wikipedia.org/wiki/Common_Blackbird','Blackbird','Turdus merula','Eurasian Blackbird','blackbird','blackbird','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(27,1,1,'',1,'',378644400,'brown','short','The Song Thrush is not usually gregarious, although several birds may roost together in winter or be loosely associated in suitable feeding habitats, perhaps with other thrushes such as the Blackbird.',1,'brown','Turdidae','garden','Thrush_song_06-03_SCOT','Common garden bird. Male and female dimorph.','brown','http://en.wikipedia.org/wiki/Song_Thrush','Song thrush','Turdus philomelos','Song Thrush','blackbird','Singdrossel_1753','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(28,1,1,'',1,'',378644400,'black','duck','odd and quirky',1,'brown/white','Anatidae','coast','ParadiseDuck','Common bird. Male and female dimorph.','brown','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/paradise-duck-putakitaki/','Paradise Shelduck','Tadorna variegata','Paradise Shelduck','duck','Tadorna_variegata100309_16','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(29,1,1,'',1,'',378644400,'black','short,pointed','nest in burrows',1,'brown','Charadriidae','coast','Charadrius_bicinctus_breeding_Ralphs_Bay','Dotterels dart around on beaches and mudflats. The banded dotterel is easily identified by its breeding colours being a narrow dark band on its neck and a wide chestnut band on the breast. Its back and wings are fawn. The Maori name for dotterel is tuturiwhatu. The banded dotterl is the most numerous dotterel in New Zealand and is both endemic (only found here) to New Zealand and a protected species. The banded dotterel breeds in a variety of habitats including on coasts, farms, and on the shores of lakes and riverbeds. They are most common in inland Canterbury and the Mackenzie Basin. The male makes several nests for the female to choose from and these are scrapes on sand or soil. Both the male and female incubate two to four eggs. After breeding most of the inland breeding birds, slightly over half of the total population of 50,000, migrate to Australia for winter.','brown','http://en.wikipedia.org/wiki/Charadrius_bicinctus','Banded dotterel','Double banded plover (Charadrius bicinctus)','Red-breasted Dotterel','blackbird','SHOREPLOVER','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(30,1,1,'',1,'',378644400,'black','long','flightless, sedentary',1,'blue','Rallidae','bush','Takahe_Maunga','Rare, large stocky bird that was thought to be extinct until it was re-discovered near Lake Te Anau (South Island) in 1948. Close relative to the Pukeko (which is smaller and lighter). The South Island takahē is a rare relict of the flightless, vegetarian bird fauna which once ranged New Zealand. Four specimens were collected from Fiordland between 1849 and 1898, after which takahē were considered to be extinct until famously rediscovered in the Murchison Mountains, west of Lake Te Anau, in 1948. Until the 1980s, takahē were confined in the wild to the Murchison Mountains. They have since been translocated to seven islands and several mainland sites, making them more accessible to many New Zealanders. Conservation work by the Department Of Conservation and community groups aims to prevent extinction and restore takahē to sites throughout their original range. The success of DOC’s Takahē Recovery Programme relies heavily on a partnership with Mitre 10 who through Mitre 10 Takahē Rescue is helping to ensure the long-term survival of this treasured species.         Identification: The South Island takahē is the largest living rail in the world. An enormous gallinule, it has deep blue on the head, neck and underparts, olive green on the wings and back, and a white undertail, The huge conical bill is bright red, paler towards the tip, and extends on to the forehead as a red frontal shield. The stout legs are red, with orange underneath. Juveniles are duller with a blackish-orange beak and dull pink-brown legs.         Voice: the main calls of takahē are a loud shriek, a quiet hooting contact call, and a muted boom indicating alarm.         Similar species: the extinct North Island takahē was taller and more slender. Pukeko can fly, and are smaller and more slender, with relatively longer legs, and black on the wings and back.','red','http://nzbirdsonline.org.nz/species/south-island-takahe','Takahe','Porphyrio hochstetteri','Takahe','goose','','Nationally Critical',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(31,1,1,'',1,'',378644400,'red','short','flightless,sedentary',1,'blue','Rallidae','coast','Pukeko_Porphyrio_porphyrio','Established in NZ ca. 1000 yrs ago they thrived in an environment in which they now face introduced predators like cats and rodents. Live in groups of 3-12; known to group together and shriek loudly to defend nests successfully during attacks by Australasian Harriers. ','red','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/pukeko/','Pukeko/ Purple Swamphen','Porphyrio porphyrio','Pukeko/ Purple Swamphen','duck','Purple_Swamphen_Tiritiri_Matangi_Island','endangered',X'');
