INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(36,1,1,'',1,'',378644400,'black','medium','diurnal',1,'grey/black','Spheniscidae','coast','Little_Penguin','The smallest species of penguin. The penguin, which usually grows to an average of 33 cm in height and 43 cmin length, found on the coastlines of southern Australia and New Zealand, with possible records from Chile. Apart from Little Penguins, they have several common names. In Australia, they are also referred to as Fairy Penguins because of their tiny size. In New Zealand, they are also called Little Blue Penguins, or just Blue Penguins, owing to their slate-blue plumage, and they are called Kororā in Māori. Rough estimates (as new colonies continue to be discovered) of the world population are around 350,000-600,000 animals.The species is not considered endangered, except for the White-Flippered subspecies found only on Banks Peninsula and nearby Motunau Island in New Zealand. Since the 1960s, the mainland population has declined by 60-70%; though there has been a small increase on Motunau Island. But overall Little Penguin populations have been decreasing as well, with some colonies having been wiped out and other populations continuing to be at risk. However, new colonies have been established in urban areas. The greatest threat to Little Penguin populations has been predation (including nest predation) from cats, foxes, large reptiles, ferrets and stoats. Due to their diminutive size and the introduction of new predators, some colonies have been reduced in size by as much as 98% in just a few years, such as the small colony on Middle Island, near Warrnambool, Victoria, which was reduced from approximately 600 penguins in 2001 to less than 10 in 2005. Because of this threat of colony collapse, conservationists pioneered an experimental technique using Maremma Sheepdogs to protect the colony and fend off would-be predators.','brown','http://en.wikipedia.org/wiki/Little_Penguin','Penguin, little blue','Eudyptila minor','Little Penguin','pigeon','Little-PenguineEudyptilaMinor_XC98203','endangered',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(37,1,1,'',1,'',378644400,'yellow','hooked','',1,'red/green/blue/yellow','Psittacidae','bush','RosellaEastern600px-Platycercus_eximius_-Buffalo_Zoo-8-3c','A parrot-like bird,the Eastern Rosella (Platycercus eximius) is a native to southeast of the Australian continent and to Tasmania. It has been introduced to New Zealand where feral populations are found in the North Island (notably in the northern half of the island and in the Hutt Valley) and in the hills around Dunedin in the South Island.','brown','http://en.wikipedia.org/wiki/Eastern_Rosella','Rosella, eastern','Eudyptila minor','Eastern Rosella','pigeon','rosellas','unknown',X'');
