INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(40,1,1,'',1,'',378644400,'black','long','',1,'black/white','Phalacrocoracidae','coast','Shag_IMG_7093','A coastal bird, also called cormorant or fregate bird. The bird family Phalacrocoracidae or the cormorants is represented by some 40 species of cormorants and shags. The species ranges across New Zealand, from Stewart Island to Northland, and across mainland Australia (although not in the arid interior of the west of the country) and Tasmania and Indonesia. Widespread and common, it lives near bodies of water such as swamps, lakes, lagoons, estuaries and the coastline.','black','http://en.wikipedia.org/wiki/Cormorant','Shag, little','Microcarbo melanoleucos','Little Pied Cormorant','duck','SHAGAuklandIs_FL Enderby26Nov2000','Naturally uncommon',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(41,1,1,'',1,'',378644400,'black','long','very shy, fast flier, preys on small animals',1,'green/blue','Alcedinidae','coast','Kingfisher_IMG_6929','A surprisingly abundant bird. With its sturdy bill the kingfisher can dig nesting holes into clayey reiver banks. ','brown','http://blog.forestandbird.org.nz/the-kingfisher-a-true-thug/#more-1047','Kingfisher','Kotare','Sacred Kingfisher','blackbird','','unknown',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(42,1,1,'',1,'',378644400,'yellow','medium','',1,'grey/brown/white','Sturnidae','coast/garden/bush','Myna_768px-Acridotheres_tristis_-Sydney,_Australia-8','A relatively abundand bird, hugely competitive. The common myna (Acridotheres tristis), sometimes spelled mynah, also sometimes known as "Indian myna", is a member of the family Sturnidae (starlings and mynas) native to Asia. An omnivorous open woodland bird with a strong territorial instinct, the myna has adapted extremely well to urban environments.         The common myna is an important motif in Indian culture and appears both in Sanskrit and Prakrit literature. "Myna" is derived from the Hindi language mainā which itself is derived from Sanskrit madanā.         The range of the common myna is increasing at such a rapid rate that in 2000 the IUCN Species Survival Commission declared it one of the world''s most invasive species and one of only three birds in the top 100 species that pose an impact to biodiversity, agriculture and human interests. In particular, the species poses a serious threat to the ecosystems of Australia where it was named "The Most Important Pest/Problem".                  The common myna is readily identified by the brown body, black hooded head and the bare yellow patch behind the eye. The bill and legs are bright yellow. There is a white patch on the outer primaries and the wing lining on the underside is white. The sexes are similar and birds are usually seen in pairs.','yellow','http://en.wikipedia.org/wiki/Myna','Myna','Myna','Myna','blackbird','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(43,1,1,'',1,'',378644400,'grey/black','short','unknown',0,'brown','Prunellidae','garden/bush/coast','Dunnock_IMG_7140','Relatively abundant in the South, scarcer in the north, introduced bird. Similar to a house sparrow though smaller.','orange/brown','http://en.wikipedia.org/wiki/Dunnock','Dunnock','Dunnock','Dunnock','sparrow','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(44,1,1,'',1,'',378644400,'orange','short','unknown',0,'green','Fringillidae','garden/bush','Carduelis_chloris_AuthorOlivierFromFranceWikiCommons','The Greenfinch has been introduced into both Australia and New Zealand from Europe. The Greenfinch is 15 cm long with a wing span of 24.5 to 27.5 cm. It is similar in size and shape to a House Sparrow, but is mainly green, with yellow in the wings and tail. The female and young birds are duller and have brown tones on the back. The bill is thick and conical. The song contains wheezes and twitters, and the male has a butterfly display flight.','orange/red','http://en.wikipedia.org/wiki/European_Greenfinch','Greenfinch','Carduelis chloris','European Greenfinch','blackbird','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(45,1,1,'',1,'',378644400,'black','short','unknown',0,'green','Cuculidae','garden/bush/coast','Chrysococcyx_lucidus_JamesNiland_Brisbane_Queensland_Australia','It is the world’s smallest cuckoo, being only 15 to 17 centimetres (5.9 to 6.7 in) in length, and parasitises chiefly dome-shaped nests of various Gerygone species, having a range that largely corresponds with the distribution of that genus. It may also parasitise other Acanthizidae species, and is also the most southerly ranging brood parasitic bird species in the world, extending to 45°S in New Zealand. Hard to spot and easier to hear, the Shining Bronze Cuckoo has metallic golden or coppery green upperparts and white cheeks and underparts barred with dark green. The female is similar with a more purplish sheen to the crown and nape and bronzer-tinged barring on the belly. The bill is black and the feet are black with yellow undersides.','black','http://en.wikipedia.org/wiki/Shining_Cuckoo','Shining Cuckoo','Chrysococcyx lucidus','Shining Bronze-Cuckoo','sparrow','Shining_BronzeCuckoo','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(46,1,1,'',1,'',378644400,'black','short','unknown',0,'blue/orange','Prunellidae','bush/coast','commonswikimedia.orgwikiFileWelcome_Swallowjpg800px-Welcome_Swallow','It is a species native to Australia and nearby islands, and self-introduced into New Zealand in the middle of the twentieth century. It is very similar to the Pacific Swallow with which it is often considered conspecific. Metallic blue-black above, light grey below on the breast and belly, and rusty on the forehead, throat and upper breast. It has a long forked tail, with a row of white spots on the individual feathers. These birds are about 15 cm (6 in) long, including the outer tail feathers which are slightly shorter in the female. ','black','http://en.wikipedia.org/wiki/Welcome_Swallow','Welcome Swallow','Hirundo neoxena','Welcome Swallow','sparrow','Hirundotahitica','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(47,1,1,'',1,'',378644400,'black','hook','unknown',0,'brown/red','Nestoridae','bush/mountain','Kaka_on_Branch','The New Zealand Kaka is a medium sized parrot, measuring 45 cm  in length and weighing from 390 to 560 g , with an average of 452 g. It is closely related to the Kea, but has darker plumage and is more arboreal.         The forehead and crown are greyish-white and the nape is greyish-brown. The neck and abdomen are more reddish, while the wings are more brownish. Both sub-species have a strongly patterned brown/green/grey plumage with orange and scarlet flashes under the wings; color variants which show red to yellow coloration especially on the breast are sometimes found. This group of parrots is unusual, retaining more primitive features lost in most other parrots, because it split off from the rest around 100 million years ago. The calls include a harsh ka-aa and a whistling u-wiia.Distribution and habitat. The New Zealand Kaka lives in lowland and mid-altitude native forest. Its strongholds are currently the offshore reserves of Kapiti Island, Codfish Island and Little Barrier Island. It is breeding rapidly in the mainland island sanctuary at Zealandia (Karori Wildlife Sanctuary/Wellington), with over 300 birds banded since their reintroduction in 2002.','black','http://en.wikipedia.org/wiki/New_Zealand_kaka','Kaka','Nestor meridionalis','Kaka','duck','','endangered',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(48,1,1,'',1,'',378644400,'brown','short','unknown',0,'brown/red','Fringillidae','open country, bush','RedpollAndyMorffew','Redpolls are the smallest of New Zealand’s introduced finches. The Redpoll is a small brownish-streaked songbird species with a bright red crown patch and a stubby yellowsh bill. Adult males have a variable amount of pink on the lower throat and breast which only appears after the second moult; some adult females and first-year males may have a slight pink flush on the breast and juveniles look similar to adult females but are paler and lack any red on the crown. The redpoll is widespread throughout the South Island, and is also found on many off-shore islands. In the North Island, it is found in all regions, but is generally less abundant than in the South Island.','black','http://en.wikipedia.org/wiki/Redpoll','Redpoll','Redpoll','Redpoll','sparrow','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(49,1,1,'',1,'',378644400,'grey','short','unknown',0,'grey','Columbidae','garden','RockPigeon','Bill: Short and slightly curved with a white crop at the base         Size: 13-14 inches long with 25-inch wingspan, stocky body and pointed wings         Colors: Blue gray, black, white, brown, iridescent         Markings: Pigeons have a wide range of color and marking variations due to escaped domestic birds and fancy stock breeding. Typical pigeons are a blue gray overall with an iridescent neck that reflects blue, green and purple. Birds may have thick black wing bars and most pigeons are light underneath the wings. Eyes and legs are orange or reddish. Additional color variations include white, brown, tan or mottled birds.         These birds thrive in human habitats and are most populous in large cities but can also be found in suburban and rural locations. Pigeons do not migrate.         Because pigeons are so used to humans, they often seem semi-tame and will readily approach passersby for food. Large flocks of pigeons are constantly foraging or birds will roost in close contact with one another. Pigeons are very agile fliers that can reach speeds up to 85 miles per hour with their tapered, falcon-like wings.         When commuting between roosting and foraging sites, rock pigeons fly directly and quickly with steady-paced wing beats. They may travel several kilometres to reach foraging sites. Rock pigeons generally forage in pairs or as a loose flock, with almost all searching for food being carried out while walking about on the ground. Often during spring and summer, males at foraging sites will court females. This involves the male standing erect with head bowed, plumage puffed out and tail fanned, walking and running about the female while cooing loudly. Nest sites are vigorously defended, sometimes resulting in fights for occupancy.','red','http://birding.about.com/od/birdprofiles/p/rockpigeon.htm','Rock Pigeon','Rock Pigeon','Rock Pigeon','pigeon','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(50,1,1,'',1,'',378644400,'brown','short','unknown',0,'brown','Larks (Alaudidae)','bush','Skylark','The skylark is a small brown bird, somewhat larger than a sparrow but smaller than a starling. It is streaky brown with a small crest, which can be raised when the bird is excited or alarmed, and a white-sided tail. The wings also have a white rear edge, visible in flight. It is renowned for its display flight, vertically up in the air. Its recent and dramatic population declines make it a Red List species.                 These birds are 14–18 cm long and live in cultivation, heath, natural steppe and other open habitats. Their characteristic songs are delivered in flight.                 Their diet consists of seeds, supplemented with insects in the breeding season. They nest on the ground in tufts of grass, with three to six eggs per clutch. They form flocks when not breeding.','brown','http://en.wikipedia.org/wiki/Skylark','Skylark','Alauda arvensis','Skylark','sparrow','','unknown',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(51,1,1,'',1,'',378644400,'black','long,hooked','unknown',0,'black,white','Procellariidae','water','BullersShearwater','A medium-large shearwater, brown-grey above and white below, with long broad wings, a dark-brown cap extending to just below the eyes, contrasting sharply with their white cheeks. The upper body surface is brown-grey with darker brown-black feathers running across the upper wings in an M-shape, and brown-grey on the rump contrasting with the much darker tail. The entire underside including the underwings is white. In the hand, the bill (38-45 mm long) is grey-black with a sharp hook to seize prey. The legs and feet are dark brown-mauve on the outside and pink on the inside.         Voice: the calls of Buller’s shearwaters resemble those of sooty shearwaters with wailing, cooing and groaning sounds.         Similar species: several other large brown-above-and-white-below shearwaters occur rarely in New Zealand waters; none have the strongly patterned two-tone upper-surface of the Buller’s shearwater. Pale morph wedge-tailed shearwaters are more uniformly dark above and duskier on the underwing. Great shearwater has a pale nape contrasting strongly with a blackish cap, a pale crescent on the rump, and a variable dark belly patch. Pink-footed shearwater has a pink bill with a dark tip, and is darker underneath than the very white Buller’s shearwater.         From Cook Strait north and especially in the Hauraki Gulf and Bay of Plenty, Buller’s shearwaters occur alongside the smaller fluttering shearwater, which is uniformly dark brown above, duskier below (especially on the underwings), and flaps more than Buller’s shearwater.         Similar species: Wedge-tailed shearwater, Great shearwater, Pink-footed shearwater, Fluttering shearwater','brown','http://nzbirdsonline.org.nz/species/bullers-shearwater','Buller''s shearwater','Buller''s shearwater','Buller''s shearwater','goose','','naturally uncommon',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(52,1,1,'',1,'',378644400,'red','long','unknown',0,'grey,white','Sternidae','coast','CaspianTern_Steintil','The world''s largest tern with a length of 48–60 cm (19–24 in), a wingspan of 127–145 cm (50–57 in) and a weight of 530–782 g (18.7–27.6 oz).Adult birds have black legs, and a long thick red-orange bill with a small black tip. They have a white head with a black cap and white neck, belly and tail. The upper wings and back are pale grey; the underwings are pale with dark primary feathers. In flight, the tail is less forked than other terns and wing tips black on the underside. In winter, the black cap is still present (unlike many other terns), but with some white streaking on the forehead. The call is a loud heron-like croak.','black','http://en.wikipedia.org/wiki/Caspian_tern','Caspian Tern','Taranui','Caspian Tern','duck','','Nationally Vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(53,1,1,'',1,'',378644400,'black','short','unknown',0,'white/grey','Laridae','coast','Black_billed_gull','The black-billed gull (Chroicocephalus bulleri), also known as Buller''s gull, is a species of gull in the Laridae family. It is found only in New Zealand and has the undesirable status of being the most threatened gull species in the world..         The black-billed gull is a lightly coloured gull with a small amount of black on its wingtips. It has a long, thin, black bill with a bright red interior, and reddish black feet and white eyes. The juvenile has a flesh coloured bill with a dark tip and dark brown eyes. As juvenile red-billed gulls display similarly dark bills and feet they may be confused with this species.         The black-billed gull is more slender and elegant than the red-billed gull, with a longer bill. Breeding adults have a white head, neck, rump, tail and underparts, and pale silver-grey wings and back. The outer primaries are mainly white with white-tipped black margins. A diagnostic white leading edge to the wing shows in flight. The bill and legs are black; during late incubation and hatching the legs become vibrant blood red. The eye is white, and the eye-ring red. Non-breeding adults have a bi-coloured bill, reddish at the base with a black tip and line through the middle.         The black-billed gull is endemic to New Zealand. Its natural habitats are rivers, freshwater lakes, freshwater marshes, sandy shores, pastureland, and urban areas. It is threatened by habitat loss. About 78% of the population breeds in the Southland Region on the southern end of South Island, New Zealand, especially beside the Mataura, the Oreti, the Aparima and Waiau Rivers. On the North Island, breeding sites are typically sand-spits, shell banks, lake margins and river flats. It feeds on fish, terrestrial, freshwater and marine invertebrates and visits farmland and refuse tips.         Similar species: in non-breeding plumage, black-billed gulls have a bi-coloured bill and red legs, and may be confused with red-billed gulls. Juvenile black-billed gulls are most confusing, as they have a dark outer leading edge to the wing (this is white in older age classes). In all plumages, black-billed gull has a longer, finer bill. Red-billed gull is darker grey with a black patch through the middle of the outer primaries, diagnostic in flight. The red bill (which is shorter and thicker) and legs lose the brighter tones of summer during autumn/winter. Adult red-billed gulls do not acquire a contrasting bi-coloured bill, though do have darker shades of red near tip and through the middle of the bill.','black','http://en.wikipedia.org/wiki/Black-billed_gull','Gull, Black-billed ','Buller''s gull','Black-billed gull','pigeon','','nationally endangered',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(54,1,1,'',1,'',378644400,'black','long','unknown',0,'grey/white','Ardeidae','coast','WhiteFacedHeron','The white-faced heron (Egretta novaehollandiae) also known as the white-fronted heron, and incorrectly as the grey heron, or blue crane, is a common bird throughout most of Australasia, including New Guinea, the islands of Torres Strait, Indonesia, New Zealand, the islands of the Subantarctic, and all but the driest areas of Australia.         It is a relatively small heron, pale, slightly bluish-grey, with yellow legs and white facial markings. It can be found almost anywhere near shallow water, fresh or salt, and although it is prompt to depart the scene on long, slow-beating wings if disturbed, it will boldly raid suburban fish ponds.','black','http://en.wikipedia.org/wiki/Redpoll','White Faced Heron','Egretta Novaehollandiae','White Faced Heron','Swan','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(55,1,1,'',1,'',378644400,'black','long','unknown',0,'white/grey/black','Sternidae','coast','WhiteFrontedTern','The white-fronted tern (Sterna striata) is the most common tern of New Zealand. It rarely swims, apart from bathing, despite having webbed feet. The species is protected.         White-fronted terns feed in large flocks by plunge diving on shoals of smelt and pilchards which have been driven to the surface by larger fish and are easily caught. Like all terns they fly with their heads and bills pointing down to see their prey.         The white-fronted tern is the most common tern on the New Zealand coastline, at times occurring in flocks of many hundreds or even thousands of birds. It is mainly a marine species that is seldom found far from the coast. The name ‘white-fronted’ refers to the ‘frons’ or forehead, where a thin strip of white separates the black cap from the black bill. Most other ‘capped’ terns, including the black-fronted tern, have black caps that reach the bill when in breeding plumage. The scientific name striata refers to the finely-barred (striated) dorsal plumage of recently fledged white-fronted terns, as the original description and name was based on a juvenile bird painted by William Ellis, surgeon’s second mate on the Discovery, on Captain Cook’s third visit to New Zealand.         Identification:                  The white-fronted tern is a medium-sized, long-tailed sea tern that is common around New Zealand coasts. It is pale grey above and white below, with a black cap that is separated from the bill by a white band (or by an entirely white fore-crown in non-breeding plumage). The tail is white and forked; the length of the tail and depth of the fork decrease in size outside of the breeding season. The outer edge of the first primary has a narrow black or brownish-black band. In the breeding season, the black cap extends from the white frontal strip down to the back of neck. Outside of the breeding season the cap recedes, leaving the forehead white. The eyelids, eyes and bill are black, and the legs vary from black to dull red-brown. Sexes are similar but females are slightly smaller. Immature birds are similar to non-breeding adults. They have the black nape streaked with white and the wing coverts and distinctive light brown mottling. Recently fledged birds have fine blackish barring (striations) over the back and wing coverts.         Calls:          the main call is a high-pitched siet; a harsh keark or keeahk is uttered by birds defending their nests.         Similar species: the white-fronted tern is easily distinguished from the two other widespread New Zealand tern species (the much larger Caspian tern, and smaller, darker black-fronted tern), but is very similar to the Arctic tern and especially the common tern, which are rare visitors to New Zealand. The white-fronted tern is the largest and palest of the three species.','black/red','en.wikipedia.org/wiki/White-fronted_tern','White fronted tern','tara, kahawai bird, sea-swallow, swallow tail','White fronted tern','pigeon','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(56,1,1,'',1,'',378644400,'grey/red','long','unknown',0,'brown','Scolopacidae','coast','BarTailedGodwit','Their brown and grey plumage echoes the intertidal mudflats where they forage, and for much of their time in New Zealand they are relatively nondescript birds. But there is nothing nondescript about the migrations of bar-tailed godwits. They perform the longest nonstop flights of any non-seabird, and, unlike a seabird, there is no chance of an inflight snack.         Godwits hold cultural significance for many New Zealanders. For Maori they were birds of mystery, (‘Who has seen the nest of the Kuaka?’) and were believed to accompany spirits of the departed; but they were also a source of food. They are the most numerous tundra-breeding shorebird species to occur in New Zealand, with around 90,000 here each year. Virtually all New Zealand birds are from the baueri subspecies breeding in western Alaska.  They are relatively common at many harbours and estuaries around the country. Following the breeding season, birds generally begin arriving from early September, usually after a non-stop 8-9 days flight. They begin departing on northern migration from early March, heading for refuelling sites around the Yellow Sea. They do not breed until their fourth year, so each southern winter there are hundreds of non-breeding birds remaining in New Zealand.','black','http://nzbirdsonline.org.nz/?q=node/670','Bar-tailed godwit','Bar-tailed godwit','Bar-tailed godwit','duck','','recovering',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(57,1,1,'',1,'',378644400,'black','short','unknown',0,'brown/red','Charadriidae','coast','NZDotterel','The New Zealand dotterel is a familiar bird of sandy east coast beaches in the northern North Island, but is sparsely distributed around much of the rest of the country. There are two widely separated subspecies: the northern New Zealand dotterel is more numerous, and breeds around the North Island; the southern New Zealand dotterel was formerly widespread in the South Island, and now breeds only on Stewart Island. Southern New Zealand dotterels are larger, heavier, and darker than northern New Zealand dotterels.         Coastal development and human recreational activities on beaches are having a growing impact on the northern subspecies; dotterels are often described as ‘appealing’, and local communities are increasingly championing them – providing advocacy and organising protection programmes to improve breeding success.                  Identification                  The New Zealand dotterel is a heavily-built plover, and is the largest species in the genus Charadrius (c.31 species). The upperparts are brown, darker in the southern subspecies, and the underparts are  off-white in autumn-early winter, becoming orange-red (also darker in southern birds) from about May onwards. The depth and extent of red colour varies individually and seasonally, but males are generally darker than females. The bill is heavy and black, and the legs mid-grey. First-winter birds have pure white underparts, with legs yellowish to pale grey.                               Voice: the common call is a sharp chip, often heard before the bird is seen. The call indicates alertness, with the rate increasing as the perceived threat level rises. The same call is also used to maintain contact. A high-pitched tseep is used to warn chicks to stay hidden. A long rattling churr is used when chasing intruders. A sharp werr-wit is used during territory boundary disputes.         Similar species: occasional confusion with eclipse or juvenile banded dotterel, but New Zealand dotterel is much larger, and bill heavier. Juvenile or eclipse New Zealand dotterel is similar to eclipse greater sand plover (rare in New Zealand) but that has slimmer body, longer legs, and the head appears larger in proportion to the body.','grey','http://en.wikipedia.org/wiki/Redpoll','NZ dotterel','NZ dotterel','NZ dotterel','pigeon','','Nationally vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(58,1,1,'',1,'',378644400,'black','short','unknown',0,'brown/red','Podicipedidae','coast','CrestedGrebe','The Crested Grebe','black','http://nzbirdsonline.org.nz/species/australasian-crested-grebe','Crested Grebe','Crested Grebe','Crested Grebe','duck','','Nationally vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(59,1,1,'',1,'',378644400,'black','long','unknown',0,'white','Ardeidae','coast','WhiteHeron','The white heron or kotuku is well-loved by the New Zealand people, but it is rarely seen except by those who specifically seek it out. Its sole New Zealand breeding site near Okarito Lagoon in Westland is well-known and well-protected, but elsewhere it is ''He kotuku rerenga tahi'' or the bird of single flight, implying something seen perhaps once in a lifetime. When seen in close proximity it is a magnificent bird, with its large size and clean white plumage.         A large white heron with a long yellow bill, long dark legs and a very long neck. When breeding, the bill becomes grey-black and long filamentous plumes develop, mainly on the back. In flight, the white heron tucks its heads back into its shoulders so that the length of its neck is hidden, giving it a hunched appearance. When walking, the white heron has an elegant upright stance showing the extreme length of its neck. When resting it is more hunched with its head tucked in, making the birds appear more bulky. Important identification characters when separating white herons from other white egret species in New Zealand include overall size, relative neck length, bill colour and shape, and how far the gape (i.e. the corner of the mouth) extends back in relation to the eye. The white heron is the largest, longest-necked of the egrets, and the gape extends well behind the eye.         Voice: a harsh croak.','black','http://nzbirdsonline.org.nz/species/white-heron','White heron','(Eastern) Great Egret','White heron','swan','','Nationally critical',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(60,1,1,'',1,'',378644400,'yellow','long','unknown',0,'white/orange','Ardeidae','coast','CattleEgret','TThe cattle egret is a widely but patchily distributed Australian migrant, reaching New Zealand in variable numbers each autumn to overwinter. It is generally found associating with cattle and sheep.         Identification: A small, stocky egret, similar in size to a white-faced heron, but not as slim and with a shorter neck. When standing, cattle egrets typically have a rather hunched posture, and when feeding they have a jerky walking action. Non-breeding plumage is entirely white, with a stout, slightly decurved yellow bill, yellow facial skin and grey legs. There is a distinctive jowl of feathers under the lower mandible. In breeding plumage there are extensive areas of ginger on the crown, neck and mantle, and long plumes on the neck and back; the legs become yellow and the bill is reddish. Birds recently arrived in New Zealand often have varying traces of breeding plumage remaining, and many colour-up prior to departure in the spring.         Voice: normally silent, except during breeding and at roosts, when various croaking and chattering calls are made.','black','http://nzbirdsonline.org.nz/species/cattle-egret','Cattle Egret','Cattle Egret','Cattle Egret','swan','','migrant',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(61,1,1,'',1,'',378644400,'black','long','unknown',0,'white','Threskiornithidae','coast','RoyalSpoonbill','Breeding and ecology: The stately royal spoonbill is one of six spoonbill species worldwide, and the only one that breeds in New Zealand. This large white waterbird was first recorded in New Zealand at Castlepoint in 1861. Sightings increased through the 1900s, with breeding first recorded next to the white heron colony at Okarito, south Westland, in 1949. Since then it has successfully colonised New Zealand from Australia and is now widespread, breeding at multiple sites on both main islands, and dispersing to coastal sites across the country after the breeding season. In flight, birds hold their neck outstretched and trail legs behind, looking rather awkward, like a "Dr Seuss" cartoon bird. Their closest relatives are the ibises.         Identification: A large, bulky, long-legged waterbird with white plumage and black spoon-shaped bill, facial skin, legs and feet. During the breeding season, adults grow distinctive long white crest feathers on the back of the head or nape, up to 20 cm long in males. The crest is raised during mating displays revealing pink skin beneath. The bill is 136 - 220 mm long; the wingspan is circa 120 cm. Breeding birds have a creamy-yellow breast, a yellow patch above each eye, and a red patch in the middle of the forehead in front of the crest feathers. Females are slightly smaller than males, with shorter legs and bill. Outside the breeding season the crest feathers are smaller and the rest of the plumage often appears soiled. Juveniles resemble non-breeding adults but are slightly smaller with a shorter bill, dark tips to the main flight feathers, and lack a crest and coloured face patches. When wading in shallow water it often submerges the bill and repeatedly sweeps it in a wide arc in search of prey.         Voice: grunts, groans and hisses with chew and cho calls made at the nest.         Similar species: there are two records of the similar yellow-billed spoonbill in New Zealand, which is slightly larger and heavier, with a pale yellowish bill and legs. The white heron is taller and thinner with a slender, pointed, bright yellow bill.','black','http://nzbirdsonline.org.nz/species/royal-spoonbill','Royal Spoonbill','Royal Spoonbill','Royal Spoonbill','swan','','Naturally Uncommon',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(62,1,1,'',1,'',378644400,'yellow','short','unknown',0,'grey/white/black','Charadriidae','coast','MaskedLapwing_JamesNiland','The New Zealand spur-winged plover population has a unique conservation trajectory among our native bird species. In just over 80 years since the first breeding record, it has gone from a fully protected native to having that protection removed in 2010. First recorded breeding near Invercargill in 1932, it subsequently spread northwards through the country, becoming established in Northland in the 1980s. A bird of open country, it is an obtrusive, noisy addition to habitats ranging from riverbeds and sea and lakeshores to agricultural pasture and urban parklands. Common names for birds can be a linguistic minefield, but our spur-winged plover should not to be confused with a species of the same name that occurs in central Africa. Given that it is actually a lapwing, perhaps it would have been easier if we had adopted its Australian name - masked lapwing.','black','http://nzbirdsonline.org.nz/species/spur-winged-plover','Plover (spur-winged)','Masked Lapwing','Masked Lapwing','duck','','Not threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(63,1,1,'',1,'',378644400,'grey','long','unknown',0,'grey/brown','Apterygidae','bush','GreatSpottedKiwi_J_Brew','The second largest of the five kiwi species. Widespread in forest, scrub, upland tussock grasslands and subalpine zones of the north-western South Island. Flightless, with tiny vestigial wings and no tail. Nocturnal, therefore more often heard than seen. Male gives a repeated high-pitched ascending whistle, female gives a slower and lower pitched ascending whistle. Plumage brownish grey finely mottled or banded horizontally with white, long pale bill, short dark legs and toes, often with dark or dark streaked claws. Large pale kiwi. Brownish grey finely mottled or banded horizontally with white, long pale bill, short dark legs and toes, often with dark or dark streaked claws.        Voice:  Male gives a high-pitched ascending whistle repeated 10-20 times, female gives a slower and lower pitched ascending trill repeated 10-15 times.        Similar species: Juvenile great spotted kiwi pass through a stage when they are similar to little spotted kiwi, but little spotted kiwi have pale legs, toes and claws. Similar to hybrid rowi or little spotted kiwi, but great spotted kiwi have much more massive legs.','black','http://nzbirdsonline.org.nz/species/great-spotted-kiwi','Kiwi (Great Spotted)','roa, roroa','Kiwi','duck','','Nationally vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(64,1,1,'',1,'',378644400,'black','hook','unknown',0,'brown/red','Falconidae','bush, garden','NZFalcon','The New Zealand falcon is a magpie-sized raptor that feeds predominantly on live prey. Adapted to hunt within the dense New Zealand forests they are also found in more open habitats such as tussocklands and roughly grazed hill country. More recently they have been discovered breeding in exotic pine plantations. Laying their eggs in simple scrapes they can nest in a variety of locations, from within the epiphytes that grow in large trees, to on the ground under small rocky outcrops. Where they nest on the ground they are well known for attacking intruders, including humans, with aggressive dive-bombing strikes to the head.','black','http://nzbirdsonline.org.nz/species/new-zealand-falcon','NZ Falcon','Bush hawk, Bush falcon, Sparrow hawk, Kareare','NZ Falcon','duck','','Nationally vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(65,1,1,'',1,'',378644400,'black','short','unknown',0,'brown/black/green','Anatidae','coast','Mallard','The Mallard','black','http://nzbirdsonline.org.nz/species/mallard','Mallard','Mallard','Mallard','duck','','least concern',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(66,1,1,'',1,'',378644400,'black','hook','unknown',0,'green','Strigoidae','bush','Kakapo','A total of 125 birds was known in September 2012. All carry radio transmitters and are intensively monitored and managed. It is possible there are a few birds remaining on Stewart Island, and perhaps even a few in Fiordland. Once found throughout New Zealand, kakapo started declining in range and abundance after the arrival of Maori. They disappeared from the North Island by about 1930, but persisted longer in the wetter parts of the South Island. The last birds died out in Fiordland in the late 1980s. A population of less than two hundred birds was discovered on Stewart Island in 1977, but this population was also declining due to cat predation. During the 1980s and 1990s the entire known population was transferred to Codfish Island off the coast of Stewart Island, Maud Island in the Marlborough Sounds and Little Barrier Island in the Hauraki Gulf. Since then birds have been moved between Codfish, Maud and Little Barrier Islands as well as to and from newly predator-free Chalky and Anchor Islands in Fiordland. Kakapo now occur only on forested islands, though they previously appeared to have inhabited a wide range of vegetation types.','black','http://en.wikipedia.org/wiki/kakapo','Kakapo','Owl-Parrot,Night parrot','Kakapo','duck','','Nationally critical',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(67,1,1,'',1,'',378644400,'grey','short','unknown',0,'grey/white','Pachycephalidae','garden,bush','Whitehead_TN','Whiteheads are gregarious songbirds that live in noisy groups of up to 8 members and that are often heard before they are seen. They are only found in the North Island where they inhabit mostly the canopy regions of tall dense forest. Their numbers have been in decline but relocations in recent years have seen some very good results with several newly established populations. Whiteheads are the only North Island hosts for the long-tailed cuckoo.        Whiteheads are small songbirds with a compact body, short tail and bill and long legs. The head and underparts are white or whitish. Upperparts, wings and tail are brown-grey. Bill, legs and eyes are dark.        Voice: whitehead song is a characteristic viu viu viu zir zir zir zir or canary-like twitter. Several other chirps or chatters are used for constant communication within the group.        Similar species: although some species such as sparrow and silvereye are similar in size, the distinct white head and underparts make the whitehead easily distinguishable from other small passerines.        Distribution and habitat:        The whitehead occurs only in the North Island of New Zealand. Its mainland distribution is south of a line connecting the Pirongia Forest, Hamilton and Te Aroha. It is locally common though patchily distributed south of this line, and to the north is limited to offshore islands and one fenced translocation site. Whiteheads are naturally common on Little Barrier and Kapiti Islands, and have been successfully introduced to Tiritiri Matangi Island, Motuora Island and Tawharanui Regional Park in the Auckland area, plus Maungatautari, Mana Island and Karori Sanctuary. Attempts to establish whiteheads in the Waitakere ranges (Ark in the Park) and at Cape Sanctuary (Hawke’s Bay) are continuing, and in 2011 or 2012 they were released on Moturoa Island (Bay of Islands) and Motuihe, Rangitoto and Motutapu Islands in the Hauraki Gulf. Although found most commonly in tall native forest and dense shrubland, whiteheads also occur in mature pine plantations.','grey','http://nzbirdsonline.org.nz/species/whitehead','Whitehead','pōpokatea, Whitehead','Whitehead','sparrow','','Not threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(68,1,1,'',1,'',378644400,'brown','short','unknown',0,'brown','Megaluridae','bush','Fernbird_BrianRalphs','More often heard than seen, fernbirds are skulking sparrow-sized, well-camouflaged birds that on the three main islands are found mainly in dense, low wetland vegetation. They have disappeared from large areas of New Zealand, including Wairarapa, Wellington and Canterbury, but remain common on the West Coast and in pockets of suitable habitat from Northland to Stewart Island. Fernbirds occupy drier shrubland and tussock habitat at a few sites, including in the Far North and on some islands. A small long-tailed songbird that is predominantly streaked brown above and pale below, with loosely-barbed plain brown tail feathers that give birds a distinctive tattered appearance, a pointed greyish-black bill and long pinkish-red legs. The mainland subspecies have a chestnut cap and a prominent pale superciliary stripe. Similar species: Dunnock         Fernbirds are closely related to the grassbirds Megalurus of Australia and Africa, and are sometimes included in that genus.','red','http://nzbirdsonline.org.nz/species/fernbird','Fernbird','mātātā, Fernbird','Fernbird','sparrow','','Declining',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(69,1,1,'',1,'',378644400,'black','curved','unknown',0,'grey/white','Charadriidae','coast','Wrybill_Ben','Breeding and ecology: The wrybill is a small pale plover which breeds only in braided rivers of the South Island. It is the only bird in the world with a laterally-curved bill (always curved to the right), which it uses to reach insect larvae under rounded riverbed stones. Wrybills are completely dependent on braided rivers for breeding; all their life stages are predominantly grey, and highly cryptic among the greywacke shingle of the riverbeds.         The wrybill is an internal migrant. After breeding, almost the entire population migrates north to winter in the harbours of the northern North Island, notably the Firth of Thames and Manukau Harbour. On their wintering grounds, wrybills form dense flocks at high-water roosts; the highly-coordinated aerial manoeuvres of these flocks have been described as resembling a flung scarf.        Identification: Wrybills are small, pale plovers that are much more approachable than most New Zealand waders. Their underparts are white, with a black upper breast band from mid-winter to the end of the breeding season. The upper parts and sides of the face are pale grey, and the forehead white. The bill is long and black, with the distal third curved 12-26° to the right. The legs are dark grey to black. The sexes are alike in eclipse plumage; juveniles lack the black breast band. In breeding plumage, males are distinguishable by a black line above the forehead; this is highly variable however, and difficult to see in some individuals.         Similar species: wrybills are unlikely to be mistaken for other species in breeding plumage or if the bill is seen well. In eclipse plumage the banded dotterel is superficially similar, but has browner upper parts and short straight bill. Confusion is possible with some rare transequatorial migrant waders, notably sanderling and terek sandpiper, but these lack the black breast band, and their bill shapes differ.        Distribution: Wrybills breed only in the South Island, east of the main divide. The large majority of the population breeds in Canterbury between the Waimakariri River in the north, and the rivers of the upper Waitaki (Mackenzie) Basin in the south. Main strongholds are the Rakaia, upper Rangitata, and Mackenzie Basin. Four rivers in Otago (Hunter, Makarora, Matukituki, and Dart) and two in North Canterbury (Ashley and Waiau) have small populations. Wrybills previously bred in Marlborough, but their breeding range has contracted southwards over the past 120 years.         From January to July, wrybills are present in harbours of the northern North Island, mainly Manukau and Firth of Thames, smaller flocks elsewhere. During migration, small flocks are often seen briefly at South Island east coast lakes and estuaries, and flocks may settle at rivermouths in the southwestern North Island.        Habitat: Wrybills breed exclusively on braided riverbeds. On their wintering grounds, they feed on inter-tidal mudflats in harbours and estuaries. High-water roosts are usually near foraging areas, commonly on local shellbanks and beaches;  occasionally on pasture. In the upper Manukau Harbour, birds regularly roost on roofs of large buildings; occasionally on tarmac at Auckland Airport. On migration, flocks generally follow coastlines, but are not averse to flying overland. A high proportion of the population passes through Lake Ellesmere on both migrations.','black','http://nzbirdsonline.org.nz/species/wrybill','Wrybill','Wrybill','Wrybill','sparrow','','Nationally vulnerable',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(70,1,1,'',1,'',378644400,'black','short','unknown',0,'brown','Motacillidae','bush','NZPipit','The New Zealand pipit is a small brown-and-white songbird that resembles a lark, but has longer legs, and walks rather than hops. They are birds of open country, including the tideline of sandy beaches, rough pasture, river beds and above the tree-line. Pipits are members of the wagtail family, and frequently flick their long tails as they walk. In flight their tails have narrow white sides – a character shared with skylarks, chaffinches, yellowhammers and cirl buntings.','black','http://nzbirdsonline.org.nz/species/new-zealand-pipit','NZ Pipit','NZ Pipit, pīhoihoi','NZ Pipit','sparrow','','declining',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(71,1,1,'',1,'',378644400,'black','short','unknown',0,'grey/brown','Scolopacidae','coast','Red_necked_stint','Stints are the smallest of the migratory waders – barely the size of a sparrow. The red-necked stint is the only stint species to regularly occur in New Zealand, with up to 200 spending the southern summer here each year. They are most often seen at high-tide roosts associating with other small waders, especially wrybills, and other sandpipers. A tiny wader with dark legs and a short straight black bill, which in breeding plumage has a distinctive rufous ‘balaclava’ but otherwise is pale grey-brown above and off-white below throughout the year. The dorsal feathers have dark shafts and pale fringes, the flight feathers are dark and the rump is white with a dark centre.','black','http://nzbirdsonline.org.nz/species/red-necked-stint','Red-necked stint','rufous-necked stint','Red-necked stint','sparrow','','',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(72,1,1,'',1,'',378644400,'black','short','unknown',0,'brown/red','Petroicidae','bush','NorthIsland_Robin_Duncan','The North Island robin occurs in forest and scrub habitats. It can be recognised by its erect stance and relatively long legs, and spends much time foraging on the ground. It is a territorial species, males in particular inhabiting the same patch of mainland forest of 1-5 ha throughout their lives. Male are great songsters, particularly bachelors, singing loudly and often for many minutes at a time. Where robins are regularly exposed to people, such as along public walking tracks, they become quite confiding, often approaching to within a metre of a person sitting quietly. Naïve juveniles will sometimes stand on a person’s boot.','black','http://www.doc.govt.nz/conservation/native-animals/birds/birds-a-z/north-island-robin-toutouwai/','North-Island Robin','Toutouwai','North-Island Robin','sparrow','','Not Threatened',X'');
INSERT INTO `ZBIRD_ATTRIBUTES` VALUES(73,1,1,'',1,'',378644400,'black','long','unknown',0,'brown/red/black','Anatidae','coast','AustralasianShoveler_digitaltrails','Shovelers are specialist filter-feeding waterfowl with a large spoon-shaped or shovel-shaped bill that is almost twice as broad at its tip than at its base and which is the bird’s most conspicuous feature. Fine lamellae extend along most of the edge of the upper mandible and it is by pushing water through this lamellae curtain that small plankton and fine seeds are extracted.         Australasian shovelers are sexually dimorphic. The males are highly coloured most of the year, when they have a blue-grey head and neck with a distinctive white crescentic band at the base of its large spatulate black bill. The breast is a mottled brown and white after breeding but becomes progressively pure white as the nuptial moult proceeds during May. Its chestnut flank is offset by a large white patch at the tail base. The eye is yellow and the legs bright orange. Females are uniformly mottled light brown with dull brown bill and eye, and brown-orange legs. In flight  Australasian shovelers have a distinctive profile with a ridiculously large bill, sharp pointed wings and very rapid wingbeats. The blue, white and green patches on the upper wing contrast with the white underwing.         Voice: Australasian shovelers are rarely vocal. Displaying males have a rapid “chuff-chuff” call, and females may give a typical descending quack quack quack.','black','http://nzbirdsonline.org.nz/species/australasian-shoveler','Australasian Shoveler','spoonbill, spoony, New Zealand shoveler','Australasian Shoveler','duck','','Not Threatened',X'');
